exports.load = function(page) {
	page.setTitle("Office");
	var $links = {};
	for (var ii = 0, jj = _$groups.length; ii < jj; ii++) {
		var $group = _$groups[ii];
		var box = page.addBox($group.$title, "h2");
		for (var mm = 0, kk = $group.$menus.length; mm < kk; mm++) {
			var $mn = $group.$menus[mm];
			var id = page.id + "-" + ii + "-" + mm;
			$links[id] = $mn;
			page.loadNewItem(box.body, {
				$category: "link",
				$skin: "s-uitest-mn",
				$bind: id
			});
		}
		((ii < 3) ? page.leftCol : page.rightCol).appendChild(box.slot);
	}
	page.applyChange({
		$links: $links
	});
};